// app/utils/crearPDF.ts
import { jsPDF } from "jspdf";
import autoTable from "jspdf-autotable";
import { ProductoSeleccionado } from "@/types/productos";

interface jsPDFWithAutoTable extends jsPDF {
  lastAutoTable?: {
    finalY: number;
  };
}

const fechaStr = new Date().toISOString().slice(0,10);
  const imgData = "data:image/jpeg;base64,";

export function generarTipoFacturaPDF(nombreCliente: string, seleccionados: ProductoSeleccionado[]) { 
  const doc = new jsPDF();
  const pageWidth = doc.internal.pageSize.getWidth();

    // === DETALLE DE LA FACTURA ===
const totalFinal = seleccionados.reduce(
  (acc, p) => acc + ( ( (p.precioUnitario * (1-p.bonificacion) ) * 1.21 * ( 1 + p.recargo ) ) * (1 + p.margenGanancia)  ) * p.cantidad,
  0
);
const tableResult = autoTable(doc, {
  startY: 70,
  margin: { top: 70, left: 10, right: 10 },
  head: [["Descripción", "Cantidad", "Precio unitario", "Total"]],
  body: seleccionados.map(producto => [
    producto.nombre,
    producto.cantidad.toString(),
    `$${producto.precioUnitario.toFixed(2)}`,
    `$${(( ( (producto.precioUnitario * (1-producto.bonificacion) ) * 1.21 * ( 1 + producto.recargo ) ) * (1 + producto.margenGanancia)  ) * producto.cantidad * producto.cantidad).toFixed(2)}`
  ]),
  foot: [[
    { content: '', colSpan: 2 },
    { content: 'TOTAL', styles: { halign: 'right', fontStyle: 'bold' } },
    { content: `$${totalFinal.toFixed(2)}`, styles: { halign: 'left', fontStyle: 'bold' } }
  ]],
  styles: {
    fontSize: 10,
    cellPadding: 3,
  },
  headStyles: {
    fillColor: [245, 245, 245],
    textColor: 0,
    fontStyle: 'bold',
  },
  bodyStyles: {
    fillColor: [255, 255, 255],
  },
  alternateRowStyles: {
    fillColor: [255, 255, 255],
  },
  footStyles: {
    fillColor: [220, 220, 220], // Gris claro
    textColor: 0,
    fontStyle: 'bold',
  },didDrawPage: (data) => {
  const margen = 10;
  const disponible = pageWidth - (margen * 2);
  const alturaHeader = 40;
  const startY = 5;

  const largeColumn = (45 * disponible) / 100
  const shortColumn = (10 * disponible) / 100
  const col1X = margen;
  const col2X = margen + largeColumn;
  const col3X = margen + largeColumn + shortColumn;

  //img
  const imgWidth = (45 * disponible) / 100;
  const imgHeight = imgWidth * (688 / 1555);
  doc.addImage(imgData, "PNG", 10, 5, imgWidth, imgHeight);
 
  doc.setFont("helvetica");
  doc.setFontSize(20);
  doc.setTextColor(100);
  doc.text("X", col2X + shortColumn / 2, startY + alturaHeader / 2, { align: "center", baseline: "middle" });

  doc.setDrawColor(100).setLineWidth(0.5);

  const centerX = col2X + shortColumn / 2;
  const centerY = startY + alturaHeader / 2;
  const size = 10; 

  const rectX = centerX - size / 2;
  const rectY = centerY - size / 2;

  doc.rect(rectX, rectY, size, size, "S");


  // Dibujar bordes para testear
  //doc.setDrawColor(0); // negro
  //doc.setLineWidth(0.5);
  // Rectángulo para columna 1 (40% del ancho)
  //doc.rect(col1X, startY, largeColumn, alturaHeader);
  // Columna 2 (20% del ancho)
  //doc.rect(col2X, startY, shortColumn, alturaHeader);
  // Columna 3 (40% del ancho)
  //doc.rect(col3X, startY, largeColumn, alturaHeader);


  doc.setFontSize(10);
  doc.text("DOCUMENTO NO VALIDO COMO FACTURA",col3X + 5,18, { baseline: "middle" });
  doc.text("PRESUPUESTO N°25-02031",col3X + 5,25, { baseline: "middle" });
  const opciones = { weekday: 'long', day: 'numeric', month: 'long', year: 'numeric' } as const;
  const fechaFormateada = new Date().toLocaleDateString('es-ES', opciones).toUpperCase();
  doc.text(fechaFormateada, col3X + 5, 32, { baseline: "middle" });;

  //SUBHEADER
  //doc.rect(10, 45, shortColumn + largeColumn*2 , 15 );

  doc.setTextColor(0);
  doc.text("Camino General Belgrano 707 - (1886) - Bernal Oeste", 10, 50 , {baseline: "middle"});
  doc.text("Tel: 011-1163-1551", pageWidth-10, 50, { align: "right",baseline: "middle" });

  doc.text("CUIT: 23-28746558-7", 10, 55, {baseline: "middle"});
  doc.text("alambradosprix@gmail.com", pageWidth-10, 55, { align: "right",baseline: "middle" });


  // Color gris (rango 0–255)
  doc.setDrawColor(180); // gris claro
  doc.setLineWidth(0.5); // opcional, grosor fino
  doc.line(10, 60, pageWidth-10, 60); // línea de izquierda a derecha de la hoja A4
  doc.line(10, 45, pageWidth-10, 45); // línea de izquierda a derecha de la hoja A4

  }
});
    
    const finalY = (doc as jsPDFWithAutoTable).lastAutoTable?.finalY || 0;
      
    // Agregar el texto debajo
    doc.setFontSize(10);
    doc.setTextColor(100);
    doc.text(
      "Los precios son de referencia al momento de la creación del presupuesto y podrán ser ajustados, sin previo aviso (la fecha es especificada en el encabezado de este documento).",
      14, // x
      finalY + 10, // y
      { maxWidth: 180 } // para que se haga salto de línea si es necesario
    );


    //footer 
    const totalPages = doc.getNumberOfPages();

    for (let i = 1; i <= totalPages; i++) {
      doc.setPage(i);
    
      const pageHeight = doc.internal.pageSize.getHeight();
      const pageWidth = doc.internal.pageSize.getWidth();
      const footerText = `Página: ${i} / ${totalPages}`;

      doc.setFontSize(10);
      doc.setTextColor(100);
      doc.text(footerText, pageWidth - 10, pageHeight - 10, { align: "right" });
    }



    // Guardar el PDF
    doc.save(`presupuesto_${nombreCliente}_${fechaStr}.pdf`);
}
